import '../styles/Financial.css';

const Financial = () => {
  return (
    <div id="root">
      <main>
        <div className="financial-container">
          <h1>Financial Page</h1>
          {/* Add your financial page content here */}
        </div>
      </main>
      <footer className="footer">
        {/* Footer content */}
      </footer>
    </div>
  );
};

export default Financial;
